Lattice Tower Design. 6 Section and total 30 m height</p>','accepted',NULL,NULL,'2024-06-12 08:02:27','2024-06-12 08:02:29'),(1125,2,'German THW Project (RCP Modification)',0,NULL,2,NULL,NULL,'<p>Mail dated Thursday, June 27, 2024 7:29 PM from Roland Stark details below changes:</p><ol><li>Cable loudspeaker will be outside of the RCP</li><li>Separate bracket for the connecter – &nbsp;you shall deliver this part</li><li>Position of the lights added</li><li>Thread for fixing loudspeaker at the top of the RCP added</li><li>Threads and centering at the bottom added</li><li>Below is the picture for the RCP in transport position – only rotation CCW is possible (view to the bottom flange).</li><li>The connectors have to be in this position.</li></ol>','accepted',NULL,NULL,'2024-06-28 07:45:00','2024-06-28 07:45:04'),(1126,17,'MTHP-A Serisi / MTHP-M Serisi  Alt ve Üst Araç Bağlantı Arayüz Revizyon',1,NULL,17,NULL,NULL,'<p>&nbsp;Parçalarda oluşan paslanma nedeni ile yeni tasarım yapılmıştır.&nbsp;</p>','accepted',NULL,NULL,'2024-07-04 11:34:04','2024-07-04 11:34:08'),(1127,11,'MTX ELEKTRONİK KONTROL SİSTEMİ',0,NULL,1,NULL,NULL,'<p>MTX ELEKTRONİK KONTROL ÜNİTESİ,EL KUMANDASI VE MAST ÜZERİ ELEKTRONİK KOMPONENTLAR</p>','accepted',NULL,NULL,'2024-07-25 05:02:56','2024-07-25 05:03:31'),(1128,11,'MTX ELECTRONIC CONTROL UNIT (ECU) ENGINEERING CHANGES',1,NULL,1,NULL,NULL,'<p>MTX Elektronik Kontrol Ünitesinin bom listesinin PDM sistemine girişinin yapılması</p><p>Bom listesinin sistem tarafından kontrol edilmesi</p>','accepted',NULL,NULL,'2024-08-05 10:43:39','2024-08-05 10:48:36'),(1129,11,'MTX HAND CONTROL UNIT ENGINEERING CHANGES',1,NULL,1,NULL,NULL,'<p>MTX El Kumandasının bom listesinin paylaşılması</p><p>El kumandası bomunun PDM sistemine girişinin yapılması</p>','accepted',NULL,NULL,'2024-08-05 10:45:06','2024-08-05 10:48:53'),(1130,11,'ON THE MAST MTX ELECTRONIC COMPONENT ENGINEERING CHANGES',1,NULL,1,NULL,NULL,'<p>MTX Mast üzerinde kulanılan elektronik komponentların belirlen