INSERT INTO `documents` VALUES (1,2,2,2,7922,1,0,1,'MN','TR','MTHP-M SERİSİ (HALATLI TİP) TELESKOBİK YÜKSELTME SİSTEMLERİ KULLANICI EL KİTABI','<p>Bu kullanıcı el kitabı, Masttech A.Ş tarafından üretilmiş olan MTHP-M serisi (WB CDL serisi) halatlı tip teleskopik mast\'ın taşıma, kurulum ve çalıştırılmasına ilişkin önemli kuralları içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 11:05:06','2023-11-28 11:05:06'),(2,2,2,2,7923,1,0,1,'MN','TR','MTHP-A SERİSİ (HALATLI TİP) TELESKOBİK YÜKSELTME SİSTEMLERİ KULLANICI EL KİTABI','<p><span style=\"background-color:rgb(255,255,255);color:rgb(122,122,122);\">Bu kullanıcı el kitabı, Masttech A.Ş tarafından üretilmiş olan MTHP-A serisi (WB CDL serisi) halatlı tip teleskopik mast\'ın taşıma, kurulum ve çalıştırılmasına ilişkin önemli kuralları içerir.</span></p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 11:06:27','2023-11-28 11:06:27'),(3,2,2,2,7924,1,0,1,'MN','TR','MTSV-A KULLANICI EL KİTABI','<p><span style=\"background-color:rgb(255,255,255);color:rgb(122,122,122);\">Bu kullanıcı el kitabı, Masttech A.Ş tarafından üretilmiş olan MTSV-A serisi (WB QEAM serisi) elektromekanik tip araca monteli teleskopik mast\'ın taşıma, kurulum ve çalıştırılmasına ilişkin önemli kuralları içerir</span></p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 11:14:01','2023-11-28 11:14:01'),(4,2,2,2,7925,1,0,1,'GR','TR','QEAM MTS-A KULLANICI EL KİTABI','<p><span style=\"background-color:rgb(255,255,255);color:rgb(122,122,122);\">Bu kullanıcı el kitabı, Masttech A.Ş tarafından üretilmiş olan MTS-A serisi (WB QEAM serisi) elektromekanik tip teleskopik mast\'ın taşıma, kurulum ve çalıştırılmasına ilişkin önemli kuralları içerir.</span></p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 11:16:52','2023-11-28 11:16:52'),(5,2,2,2,7926,1,0,1,'MN','TR','MTT KULLANICI EL KİTABI','<p>Bu el kitabı Masttech MTT (WB EML-C) elektromekanik teleskopik mast sisteminin, işletme, bakım, arıza bulma ve montajı ile ilgili talimatları içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 13:00:33','2023-11-28 13:00:33'),(6,2,2,2,7927,1,0,1,'MN','TR','MTX SERİSİ TELESKOBİK YÜKSELTME SİSTEMLERİ KULLANICI EL KİTABI','<p>Bu el kitabı, Masttech MTX (WB EML-AL) elektromekanik teleskopik mast sisteminin işletme, bakım, arıza bulma, montaj talimatlarını içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 13:04:29','2023-11-28 13:04:29'),(7,2,2,2,7928,1,0,1,'MN','TR','MTPC KULLANICI EL KİTABI','<p>Bu el kitabı, Masttech MTPC pnömatik sisteminin kurulum, çalıştırma, nakliye, bakım, depolama ve arıza giderme prosedürlerini açıklamaktadır. Pnömatik Sistem kompresör ünitesi, pnömatik hava geçiş sistemi, anahtarlama kontrol sistemi, el tipi uzaktan kumanda ve hortum bağlantı ünitesini içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-11-28 13:21:57','2023-11-28 13:21:57'),(8,2,2,2,7929,1,0,1,'GR','TR','NIGHT SCAN LITE™ and INFLEXION HD™ KULLANICI EL KİTABI','<p>Bu kılavuzda, Night Scan Lite™ ve Inflexion HD™ için kurulum, işletme, taşıma, bakım ve sorun giderme prosedürleri açıklanmaktadır. Tipik bir Night Scan Lite veya Inflexion HD şunlardan oluşur:</p><ul><li>Mast Montajı</li><li>Bağlantı Kutusu (P/N: 5549701)</li><li>El Kumandası (P/N: 5547101)</li><li>Bağlantı Kutusu Kablosu (P/N: 218103 belirtilen uzunlukta kesilmiş veya P/N: 5563301 15m kablo)</li></ul>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-04 12:26:09','2023-12-04 12:26:09'),(9,2,2,2,7930,1,0,1,'MN','TR','MTP-M KULLANICI EL KİTABI','<p><span style=\"color:black;\">Bu kılavuzda Pnömatik Mast Sistemi için kurulum, işletme, taşıma, bakım, depolama ve sorun giderme prosedürleri açıklanmaktadır.&nbsp;</span></p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-06 06:59:49','2023-12-06 06:59:49'),(10,2,2,2,7931,1,0,1,'MN','TR','MTPQ-NN KULLANICI EL KILAVUZU',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-06 07:06:52','2023-12-06 07:06:52'),(11,2