 08:04:47'),(23,1,2,1,7944,1,0,1,'TR','TR','ROKETSAN Projesi 4MTX İçin Yapılan Sertifikasyon Test Raporları','<p>ROKETSAN ve S-TEST tesislerinde farklı zaman dilimlerinde yapılmıştır. Testler Mast Kontrol Kutusu ile birlikte yapılmıştır.</p><ul><li>Solar Radiation Test</li><li>Salt Fog Test</li><li>Icing-Freezing Rain Test</li><li>Dust Test</li><li>Sand Test</li><li>Vibration Test</li><li>Shock Test</li><li>High and Low Temperature</li><li>Humidity Test</li><li>Rain Test</li><li>EMI/EMC Test</li></ul>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2023-12-07 06:21:30','2023-12-11 09:41:54'),(24,2,2,2,7945,1,0,1,'TR','TR','MTS BOĞUM ÜST FLANŞ BAĞLANTISI YÜK TESTİ ','<p>Bu rapor, MTS-M, MTS-A, MTSV-M, MTSV-A mastlarının boğumlarının üstünde yer alan flanşların geometrilerinde yapılan değişikliklerin yükleme dayanımı testini ve sonuçlarını sunmak üzere hazırlanmıştır.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-11 09:33:55','2023-12-12 11:53:37'),(25,1,2,1,7946,1,0,1,'AR','EN','Engineering Memo for 1.25-4M PML 160','<p>David Stewart için Fransa daki müşteri için hazırlanmıştır.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2023-12-15 11:03:20','2023-12-22 14:09:51'),(26,2,2,2,7947,1,0,1,'TR','TR','KAZIK ÇAKMA TESTİ','<p>Bu rapor, gergi halatı montaj kazıklarının sert toprağa çakılması testinin sonuçlarını sunmak üzere hazırlanmıştır.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-21 08:04:48','2023-12-21 08:04:48'),(27,2,2,2,7948,1,0,1,'PR','TR','ANTEN DEVİRME MEKANİZMASI KAVRAMSAL TASARIMI','<p>&nbsp;Bu sunum, ASELSAN\'ın isteği kapsamında hazırlanan anten devirme mekanizması ile ilgili kavramsal tasarımı içermektedir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2023-12-22 07:05:02','2023-12-22 14:25:03'),(28,1,2,2,7949,1,0,1,'PR','TR','9MTHP-M6-2.1 Antenli Sehim Testi Yükleri','<p>Bu sunum ASELSAN Projesi için, 9MTHP-M6-2.1 mastında ASELSAN anteni ve döndürme mekanizması ile birlikte yapılacak sehim testi için kullanılacak test yüklerinin hesaplanmasını içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2023-12-22 07:47:06','2023-12-22 08:34:22'),(29,2,2,2,7950,1,0,1,'TR','EN','Vibration and Shock Testing of Pneumatic System (MTPC)','<p>Test videosu ve görselleri aşağıdaki bağlantıda bulunmaktadır.</p><p>\\\\filesrv01\\Users\\Koral Toptop\\01-PROJE KLASÖRÜ\\390-MTPC\\02-TASARIM DOĞRULAMA SÜRECİ\\Titresim test (Roketsan 1 Haziran 2022)</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2023-12-27 07:14:07','2023-12-27 07:16:46'),(30,2,2,2,7951,1,0,0,'TR','TR','9MTHP-M6-2.1 ANTENLİ SEHİM TESTİ','<p>Bu rapor, 9MTHP-M6-2.1 mastına ASELSAN tarafından sağlanan “anten ve katlama mekanizması” (Faydalı yük) takılıyken yapılan sehim testini ve sonuçlarını kapsamaktadır.</p>','[]',NULL,2,NULL,NULL,NULL,NULL,'Released','2023-12-27 08:57:24','2024-01-02 12:54:00'),(31,2,2,2,7951,2,0,1,'TR','TR','9MTHP-M6-2.1 ANTENLİ SEHİM TESTİ','<p>Bu rapor, 9MTHP-M6-2.1 mastına ASELSAN tarafından sağlanan “anten ve katlama mekanizması” (Faydalı yük) takılıyken yapılan sehim testini ve sonuçlarını kapsamaktadır.</p><p>Rev2 tarifi: Sayfa 6, Tablo 1\'de &nbsp;KAPALI, AÇIK BOY verilerindeki Typo hatası düzeltildi.</p>','[]',NULL,2,NULL,NULL,NULL,NULL,'Released','2024-01-02 12:54:00','2024-01-02 13:10:14'),(32,2,2,3,7952,1,0,1,'GR','TR','KOMPOZİT TEKERLEKLİ ARAÇ TİTREŞİM TESTİ PROSEDÜRÜ','<p>Ürün (Mast: 6MTX-HD7-1.45, Kontrol Ünitesi: Tip1_V1) &nbsp;MIL-STD-810F Metot 514.5 Prosedür 1, Kategori 20, Tablo 514.5C-VII, Şekil 514.5C-3 Composite Wheeled Vehicle verilerine göre, fikstüre montajlı olarak her eksende test edilecektir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-01-03 10:58:04','2024-01-03 12:44:48'),(33,3,2,3,7953,1,1,1,'GR','TR','FONKSİYONEL ŞOK TESTİ PROSEDÜRÜ','Ürün (Mast: 6MTX-HD7-1.45, Kontrol Ünitesi: Tip1_V1) ;MIL-STD-810F Metot 516.5 Prosedür 1, (20g, 11ms) verilerine göre, fikstüre montajlı olarak her eksende test edilecektir.','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-01-03 12:42:15','2024-01-03 12:44:28'),(34,3,2,3,7954,1,0,1,'GR','TR','FONKSİYONEL ŞOK TESTİ PROSEDÜRÜ','Ürün (Mast: 6MTX-HD7-1.45, Kontrol Ünitesi: Tip1_V1) ;MIL-STD-810F Metot 516.5 Prosedür 1, (20g, 11ms) verilerine göre, fikstüre montajlı olarak her eksende test edilecektir.','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-01-03 12:48:27','2024-01-03 12:48:27'),(35,1,2,1,7955,1,0,0,'ME','EN','Engineering Memo for Tekatron 2.5MTX','<p>5 Ocak 2023 tarihinde TEKATRON firması ile yapılan toplantı işlem maddesine karşılık olarak hazırlanmıştır.</p>','[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-01-08 14:07:26','2024-02-27 13:12:30'),(36,2,2,2,7956,1,0,1,'MN','EN','HURRY-UP PUMP MAST OPERATIONS MANUAL','<p>This manual describes the installation, operation, transportation, maintenance, storage, and troubleshooting procedures for the Hurry-Up Pump Mast (HUPM) system.&nbsp;</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-01-15 14:11:52','2024-01-15 14:11:52'),(37,1,2,1,7957,1,0,1,'PR','EN','Engineering Memo for 10MTS Deflection and Guying Tension Calculation','<p>This document is prepared to answer questions of Felix on 15.01.2024 Pzt 11:29</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2024-01-16 07:34:50','2024-01-16 07:44:30'),(38,1,2,2,7958,1,0,1,'TR','EN','COMPRESOR OPERATIONAL TEMPERATURE MEASUREMENT TEST','<p>The context of this test is to measure the temperatures on the tubes of the MTPC when it is operational. The copper tubes can cause stresses in various vibration environments and shall be replaced with suitable plastic tubes.&nbsp;</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2024-01-24 06:12:45','2024-01-24 08:27:47'),(39,2,2,2,7959,1,0,1,'MN','EN','PNEUMATIC TELESCOPIC MAST NON-LOCKING (PMNL) OPERATION MANUAL','<p>This manual describes the installation, operation, transportation, maintenance, storage, and troubleshooting procedures for the Pneumatic Telescopic Mast Non-Locking (PMNL) system.&nbsp;</p><p><span style=\"color:black;\">PMNL s