This manual is for the following QEAM MTS-Ms:</p><ul><li style=\"text-align:justify;\">18MTS-A6-3.7 (P/N: 38949-0)</li><li style=\"text-align:justify;\">19MTS-A6-3.7 (P/N: 38950-0)</li><li style=\"text-align:justify;\">18MTS-A7-3.7 (P/N: 38947-0)</li><li style=\"text-align:justify;\">19MTS-A7-3.7 (P/N: 38948-0)</li></ul>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-03-05 07:21:17','2024-03-05 07:21:17'),(45,1,2,1,7955,3,0,0,'ME','EN','Engineering Memo for Tekatron 2.5MTX','<p>Ağırlık düzenlemesi sonucunda tüm analiz tekrar edilmiştir.</p>','[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-03-12 08:24:37','2024-03-22 06:46:11'),(46,1,2,1,7963,1,0,1,'ME','EN','6MTS-M5 Engineering Memo','<p>D7964 R1 Numaralı belgede 10MTS için yapılan test değerleri var</p>','[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-03-13 11:17:38','2024-03-13 11:46:07'),(47,1,2,1,7964,1,0,1,'TR','TR','TELESCOPIC MAST (FOR 10MTS-M7-2.2) WIND LOAD TEST REPORT',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-03-13 11:37:37','2024-03-13 11:37:37'),(48,1,2,2,7955,4,0,1,'ME','EN','Engineering Memo for Tekatron 2.5MTX','<p>Faydalı yük için yapılan \"Effective Perpendicular Load on Mast (N)\" hesabındaki hata düzeltilerek, tüm analiz tekrar edilmiştir.</p>','[]',NULL,2,NULL,NULL,NULL,NULL,'Released','2024-03-22 06:46:11','2024-03-22 08:28:53'),(49,1,3,1,7965,1,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-05-02 09:14:24','2024-05-06 06:29:15'),(50,1,2,2,7965,2,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-05-06 06:29:15','2024-05-24 13:21:05'),(51,3,2,3,7966,1,0,1,'TR','TR','3MTX-Gereksinim Uygunluk Değerlendirme Raporu','<p><strong>OPERASYONEL KABİLİYET, HAYATTA KALMA KABİLİYETİ, SEHİM ANALİZLERİ, AÇISAL DÖNME TESTLERİNİ İÇERİR.</strong></p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-05-13 05:55:15','2024-05-13 05:55:15'),(52,3,2,3,7967,1,0,1,'TR','TR','3MTX-Eğim Testi','<p>10 Derece açı ile çalışma test raporunu içerir.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-05-13 05:56:50','2024-05-13 05:56:50'),(53,1,2,1,7965,3,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-05-24 13:21:05','2024-10-18 03:41:17'),(54,1,2,1,7968,1,0,1,'AR','TR','10MTS Sehim Hesaplama','<p>Hesaplamalarda:</p><ul><li>Rüzgar Yükleri (<a href=\"https://eurocodeapplied.com/design/en1991/wind-force-cylinder\">Calculation of wind load on circular cylinders - Eurocode 1 (eurocodeapplied.com)</a>)</li><li>10MTS boru malzemesinin \"Young Modulus\" değeri 50 Gpa ve \"Poissons\' Ratio\" 0.3 alınmıştır.</li><li>Halatlar için \"Young Modulus\" 3 GPa alınmıştır.<ul><li>Nylon 2-4 GPa (Ref : <a href=\"https://www.bestech.com.au/wp-content/uploads/Modulus-of-Elasticity.pdf)\">https://www.bestech.com.au/wp-content/uploads/Modulus-of-Elasticity.pdf)</a></li></ul></li></ul>','[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-06-10 11:15:32','2024-06-10 13:40:30'),(55,2,2,3,7969,1,0,1,'AR','TR','MTT ve MTX AİLESİ MASTLARIN GENEL TASARIM PARAMETRELERİ HESAPLAMALARI',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-08-07 10:23:42','2026-01-31 10:34:54'),(56,2,2,2,7970,1,0,1,'TR','EN','WIND LOAD TEST REPORT, 18MTS-M7-3.7 (QEAM)','<p>This test has been executed on Aug 15, 2024 at Masttech facilities.</p>','[]',NULL,2,NULL,NULL,NULL,NULL,'Released','2024-08-15 10:24:30','2024-08-15 12:40:01'),(57,17,2,2,7971,1,0,1,'TR','TR','SEHİM HESAPLAMASI, FONKSİYONEL ve ÖMÜR TEST RAPORU','<p>Bu rapor, 3220189 numaralı HİDROMEKANİK YÜKSELTME SİSTEMİ TASARIMI VE PROTOTİP İMALATI başlıklı projenin 2024 yılı birinci dönem raporunda (son rapor) belirtilen MTS teleskopik mast prototipine ait rüzgar yükü ve sehim hesaplamaları ile fonksiyonel ve ömür testi faaliyetlerini anlatmaktadır.&nbsp;</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-08-23 04:41:32','2024-08-26 09:19:57'),(58,1,2,1,7965,4,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-10-18 03:41:17','2024-10-28 05:43:35'),(59,1,2,2,7972,1,0,1,'MN','TR','Night Glare User Manual',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-10-22 05:56:44','2025-01-10 11:11:52'),(60,1,2,1,7965,5,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-10-28 05:43:35','2024-11-08 08:04:47'),(61,1,2,1,7965,6,0,0,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Released','2024-11-08 08:04:46','2025-12-09 07:53:54'),(62,1,3,2,7973,1,0,0,'AR','EN','28 m Lattice Tower Static Analysis Report ',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2024-11-20 04:23:23','2025-02-06 03:43:37'),(63,1,2,1,7974,1,0,1,'GR','TR','ERS Dökümantasyon',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2024-12-24 09:52:22','2024-12-29 06:14:03'),(64,1,3,2,7973,2,0,0,'AR','EN','28 m Lattice Tower Static Analysis Report ','<p>Payload ağırlığı 1500 kg\'a çıkarıldı ve rüzgar alanları istenilen değerde güncellendi. Çapraz boru çap ve kalınlıkları güncellendi.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2025-02-06 03:43:37','2025-05-23 08:58:10'),(65,1,3,1,7975,1,0,1,'GR','EN','Lattice Tower Schedule',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-02-06 11:24:27','2025-02-06 11:25:01'),(66,1,3,1,7976,1,0,0,'GR','TR','40m Teleskopik Kafes Kule Analiz Raporu',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2025-03-03 08:56:38','2025-03-07 05:41:14'),(67,1,3,1,7976,2,0,1,'GR','TR','40m Teleskopik Kafes Kule Analiz Raporu',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-03-07 05:41:14','2025-03-07 05:41:14'),(69,20,2,20,7978,1,0,1,'TR','TR','PASLANMAZ ÇELİK MTPM KİLİTLERİ TUZ TESTİ RAPORU','<p>MTPM ürünlerinde kullanılan kilit parçalarının paslandığı, müşteri şikayetleriyle iletilmiştir. Bu rapor mevcut kilit parçalarının yerine geçecek pas