 ORTAK\\DOKÜMANLAR\\GÖRSEL KAYITLAR\\ARALDİTE 2015-1 YAPIŞMA TESTİ GÖRSELLERİ dosya konumunda bulunmaktadır.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-08-06 11:16:21','2025-08-07 06:24:21'),(77,3,2,3,7984,1,0,1,'GR','TR','10MTX’İN 4MTX’E TASARIM BENZEŞİM RAPORU','<p>10MTX-HD7-2 MASTININ &nbsp;4MTX-S4-1.4’E TASARIM BENZEŞİM RAPORUDUR.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-09-08 05:22:11','2025-09-08 05:22:11'),(78,3,2,3,7985,1,0,1,'AR','TR','5, 8, 12, 15 METER MAST STRENGTH REPORT (15MTS-M7-2.9)','<p>15MTS-M7-2.9 MASTININ FARKLI BOYLARDA AÇILARAK (5, 8, 12, 15) DAYANIM ANALİZİNİ İÇERİR.</p><p>ANALİZE İLŞKİN DOSYA YOLU \\\\filesrv01\\Muhendislik\\TASARIM ORTAK\\ASELSAN 15MTS-M7 ANALİZ</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-09-16 08:27:31','2025-09-16 08:54:54'),(79,3,2,3,7986,1,0,1,'GR','TR','10MTX SANDIK İLE TAŞIMA DAYANIM RAPORU','<p>ROKETSAN TARAFINDAN İSTENİLEN DEMİRYOLU, DENİZYOLU VE HAVA ARACIYLA NAKLİYE TAŞIMA TESTLERİNİN HESABINI İÇERİR.&nbsp;</p><p>DOSYA YOLU \\\\filesrv01\\Muhendislik\\TASARIM ORTAK\\ROKETSAN 7421</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-09-17 04:35:05','2025-09-17 04:46:12'),(80,1,2,2,7965,7,0,1,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu',NULL,'[]',NULL,1,NULL,NULL,NULL,NULL,'Verbatim','2025-12-09 07:53:54','2025-12-09 08:24:36'),(81,4,2,4,7987,1,0,1,'AR','TR','Mobil Baz İstasyonu Yapısal Dayanım Raporu (Devrilme Analizi)',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Verbatim','2025-12-19 02:36:58','2025-12-19 02:38:59'),(82,1,3,2,7973,4,0,0,'AR','EN','28 m Lattice Tower Static Analysis Report ','<p>Revised to add bolt and weld capacity, to replace Dia 35 tubes with Dia 40 mm tubes in Section 4 to add Upper Pulley Assemblies.</p>','[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2026-01-12 06:29:24','2026-01-12 08:56:22'),(83,2,2,2,7988,1,0,1,'TR','EN','TENSILE TESTING OF WELDED ALUMINUM CROSSBAR SPECIMENS',NULL,'[]',NULL,NULL,NULL,NULL,NULL,NULL,'Frozen','2026-01-12 06: