INSERT INTO `ecns` VALUES (1071,5,1107,'<p>MTS mastı için uygulanacak değişiklikler:</p><ol><li>Guying için kullanılan kazıkların uç geometrisi kütleştirilecek ve malzemeye ısıl işlem uygulanarak sertleştirilecek.</li><li>El çarkı kaynaklı montaj braketi hafifletilecek.</li><li>El çarkı arka plakası bağlantı delikleri 3\'e çıkarılacak. 2 adet pin deliği açılacak.</li><li><span style=\"color:black;\">Taban plakası tasarımı daha oval ve çukur bir yuva olacak şekilde güncellenecek.</span></li></ol>','complete','2023-12-11 14:00:47','2024-07-25 06:11:56'),(1072,1,1110,'<p>TURKCELL Lattice Tower Düzenlemeleri. Yeni seri üretim için gereken tüm düzeltmeler ve iyileştirmeler.</p>','wip','2023-12-12 11:09:29','2023-12-27 06:53:39'),(1073,2,1112,'<p>ECN kapsamında yapılacak değişiklikler:</p><ol><li>Satın alınan tüm parçaların PDM\'e girilerek tam olarak tanımlanması</li><li>Isıtıcı montaj braketinin ve şasenin güncellenmesi (eski ısıtıcı montaj braketinin silinmesi)</li><li>3D modelde yer almayan ancak üretimde görülen unsurların düzenlenmesi (hava panjurları, perçin somun havşaları)</li><li>Eksik Pnömatik Sistem unsurlarının 3D modele eklenmesi</li><li>Açınım ölçülerinin güncellenmesi (K faktör değerleri hatalıydı)</li><li>Sonuç olarak BOM\'un güncellenmesi</li></ol>','complete','2024-01-02 11:46:22','2024-07-25 06:12:43'),(1074,1,1116,'<p>6MTX Ocak 2024 S-Testte yapılan Titreşim Test Sırasında Çıkan Sorunları düzeltmek için gereken çalışmalar.</p><p>Bir adet çelik pul üretilmesi: (Z- yükünü alabilmek içi yay yerine pul eklenmesi)</p>','complete','2024-01-04 12:39:01','2024-01-24 07:14:43'),(1075,1,1117,'<p>Titreşim dayanımını arttırmak için :</p><ul><li>\"Air outlet\" borusu malzemesinin bakırdan PVC\'ye dönüştürülmesi</li><li>Manometre borusu malzemesinin bakırdan PVC\'ye dönüştürülmesi</li><li>Plastik üst sıcaklık sınırının belirlenmesi amacıyla bir test yapılması</li></ul>','complete','2024-01-24 06:16:01','2024-01-24 06:37:56'),(1077,2,1121,'<p>ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir:</p><ol><li>Kullanılan tüm etiketler eklenecektir.</li><li>Kulpa ait bağlayıcılar eklenecektir.</li><li>102785 ve 102786 TTAF konnektörlerine ait hataları giderilmiş specification (pdf) PDM\'e yüklenecektir.</li></ol>','wip','2024-02-01 07:37:58','2024-02-01 11:47:08'),(1078,1,1122,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-04-30 07:32:26','2024-04-30 07:32:26'),(1079,1,1123,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-05-16 06:36:57','2024-05-16 06:36:57'),(1080,1,1124,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-06-12 08:02:29','2024-06-12 08:02:29'),(1081,2,1125,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-06-28 07:45:04','2024-06-28 07:45:04'),(1082,17,1126,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-07-04 11:34:08','2024-07-04 11:34:08'),(1083,1,1127,'<p>Bu ECN kapsamında:</p><p>Mast üzerinde kullanılan elektronik komponentların eklenmesi</p><p>ECU (Elektronik Kontrol Ünitesi) içerisinde kullanılan komponentların eklenmesi</p><p>El kumandası üzerinde kullanılan komponentların eklenmesi</p><p>Dış kablaj dokümanlarının oluşturulması</p><p>Dış kablajlarda kullanılan malzemelerin eklenmesi</p><p>İç kablaj dokümanının oluşturulması</p>','wip','2024-07-25 05:03:31','2024-07-25 05:09:20'),(1084,1,1128,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-08-05 10:48:36','2024-08-05 10:48:36'),(1085,1,1129,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-08-05 10:48:53','2024-08-05 10:48:53'),(1086,1,1130,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-08-05 10:49:00','2024-08-05 10:49:00'),(1087,1,1131,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-08-19 07:50:27','2024-08-19 07:50:27'),(1088,1,1132,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-09-02 06:02:53','2024-09-02 06:02:53'),(1089,17,1133,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-10-31 07:50:04','2024-10-31 07:50:04'),(1090,17,1134,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-11-18 08:43:03','2024-11-18 10:22:08'),(1091,17,1135,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2024-11-19 04:19:50','2024-11-19 04:19:50'),(1092,17,1136,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-01-03 03:27:59','2025-01-03 03:27:59'),(1093,2,1137,'<ol><li>Kule (40m, 20m, 9 m)</li><li>Kule Taşıyıcı Yapıları (Ön ve Arka)</li><li>Açılır Kapanır Ayaklar</li><li>Römork</li><li>Elektrik Motoru</li><li>Kontrol Panosu</li></ol>','wip','2025-02-10 06:16:39','2025-02-10 06:28:07'),(1094,17,1138,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-03-06 04:46:20','2025-03-06 04:46:20'),(1095,1,1139,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-03-12 05:44:33','2025-03-12 05:44:33'),(1096,17,1140,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-03-21 05:05:04','2025-03-21 05:05:04'),(1097,17,1141,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-05-16 10:29:13','2025-05-16 10:29:13'),(1098,17,1142,'ECN için yapılması gerekenlerin ayrıntılı bir şekilde açıklanması gerekmektedir.','wip','2025-05-27 05:24:24','2025-05-27 05:24:24'),(1099,2,1143,'<p>Şartname\'de yer alan \"Tablo 1 - Set Konfigürasyonu\" bölümünde belirtilen aşağıdaki birimlerin \"RENK 1: -0009/01\", \"RENK 2: -0010/01\", \"RENK 3: -0011/01