CREATE TABLE `items` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `updated_uid` int NOT NULL,
  `part_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `isSellable` tinyint(1) DEFAULT '0',
  `user_id` bigint unsigned NOT NULL,
  `c_notice_id` bigint unsigned DEFAULT NULL,
  `malzeme_id` bigint unsigned DEFAULT NULL,
  `unit` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'mm',
  `part_number` int NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `part_number_mt` text COLLATE utf8mb4_unicode_ci,
  `part_number_wb` text COLLATE utf8mb4_unicode_ci,
  `has_mirror` int DEFAULT NULL,
  `is_mirror_of` int DEFAULT NULL,
  `standard_family_id` int DEFAULT NULL,
  `standard_number` text COLLATE utf8mb4_unicode_ci,
  `std_params` text COLLATE utf8mb4_unicode_ci,
  `bom` json DEFAULT NULL,
  `makefrom_part_id` int DEFAULT NULL,
  `version` int NOT NULL DEFAULT '0',
  `is_latest` tinyint(1) NOT NULL DEFAULT '1',
  `vendor` text COLLATE utf8mb4_unicode_ci,
  `vendor_part_no` text COLLATE utf8mb4_unicode_ci,
  `url` text COLLATE utf8mb4_unicode_ci,
  `weight` float(8,3) DEFAULT NULL,
  `material_text` text COLLATE utf8mb4_unicode_ci,
  `finish_text` text COLLATE utf8mb4_unicode_ci,
  `remarks` text COLLATE utf8mb4_unicode_ci,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'WIP',
  `checker_id` bigint unsigned DEFAULT NULL,
  `approver_id` bigint unsigned DEFAULT NULL,
  `reject_reason_check` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `reject_reason_app` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `check_reviewed_at` date DEFAULT NULL,
  `app_reviewed_at` date DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `hasConfigurations` tinyint(1) DEFAULT '0',
  `basePartId` int DEFAULT '0',
  `config_number` varchar(16) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2617 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
